ALTER procedure [dbo].[AttendanceReports]
             @InstituteId int=0
			,@AcademicSessionId int=0
			,@AcademicBranchId int=0
			,@AcademicClassesId int=0
			,@AcademicSectionId int=0
			,@AcademicPeriodId int=0
			,@Year int=0
			,@Month int=0
			,@Day int=0
			,@StudentId int=0

as 
   --Institute info
   exec SprInstituteInfo @InstituteId

   --Attendance Type wise and calss wise Student
   select SAttDet.AttendanceTypeId as attendancetypeid
         ,At.Name as attendancetypename
		 ,StA.AcademicClassId as academicclassid
		 ,AC.Name as classname
		 ,COUNT(SAttDet.AttendanceTypeId) as totalcount
    from StudentAttendanceDetails as SAttDet
	inner join StudentAttendances as StA on StA.Id=SAttDet.StudentAttendanceId  
    inner join AttendanceTypes as at on at.Id=SAttDet.AttendanceTypeId
	inner join Students as st on st.StudentId=SAttDet.StudentId
	inner join AcademicClasses as Ac on Ac.Id =st.CurrentAcademicClassId
	    where 1=1 
		    and @InstituteId=case when @InstituteId=0
		                           then  @InstituteId
								   else Ac.InstituteId
								   end
		   and @AcademicSessionId=case when @AcademicSessionId=0
		                           then  @AcademicSessionId
								   else StA.AcademicSessionId
								   end
		   and @AcademicBranchId=case when @AcademicBranchId=0
		                           then  @AcademicBranchId
								   else StA.AcademicBranchId
								   end
		   and @AcademicClassesId=case when @AcademicClassesId=0
		                           then  @AcademicClassesId
								   else StA.AcademicClassId
								   end
		  and @AcademicSectionId=case when @AcademicSectionId=0
		                           then  @AcademicSectionId
								   else StA.AcademicSectionId
								   end
		  and @AcademicPeriodId=case when @AcademicPeriodId=0
		                           then  @AcademicPeriodId
								   else StA.AcademicPeriodId
								   end
		  and @Year=case when @Year=0
		                           then  @Year
								   else year(StA.AttendanceDate)
								   end
         and @Month=case when @Month=0
		                           then  @Month
								   else  month(StA.AttendanceDate)
								   end
         and @Day=case when @Day=0
		                           then  @Day
								   else day( StA.AttendanceDate)
								   end
         and @StudentId=case when @StudentId=0
		                           then  @StudentId
								   else st.StudentId
								   end
	group by SAttDet.AttendanceTypeId,At.Name,StA.AcademicClassId,AC.Name

	---Attendance Details
	select
	      StA.AcademicSessionId as academicsessionid
		 ,acsess.Name as accademicsesionname
		 ,StA.AcademicBranchId as academicbranchid
		 ,acbran.Name as accademicbranchname
	     ,StA.AttendanceDate as attendancedate
		 ,StA.AcademicClassId  as academicclassid
		 ,AC.Name as academicclassname	
		 ,StA.AcademicSectionId  as academicsectionid
		 ,acsection.Name as accademicsectionname
		 ,StA.AcademicPeriodId as academicperiodid	
		 ,acperiod.Name as academicperiodname	 
	     ,SAttDet.StudentId   as studentid
	     ,UInfo.Name as studentname 
		 ,St.CurrentRollNo as rollno
	     ,SAttDet.AttendanceTypeId as attendancetypeid
         ,At.Name as attendancetypename
		 ,SAttDet.Comments as comments
		
      from StudentAttendanceDetails as SAttDet
	inner join StudentAttendances as StA on StA.Id=SAttDet.StudentAttendanceId 
    inner join Students as st on st.StudentId=SAttDet.StudentId 
	inner join UserInfoes as UInfo on UInfo.Id=SAttDet.StudentId
	inner join AcademicBranches as acbran on acbran.Id=StA.AcademicBranchId
	inner join AcademicSessions as acsess on acsess.Id=StA.AcademicSessionId
	inner join AcademicSections as acsection on acsection.Id=StA.AcademicSectionId
	inner join AcademicClasses as ac on ac.Id=StA.AcademicClassId
	left join AcademicPeriod as acperiod on acperiod.Id=StA.AcademicPeriodId
	
	
	
    inner join AttendanceTypes as at on at.Id=SAttDet.AttendanceTypeId

	

        where 1=1 
		    and @InstituteId=case when @InstituteId=0
		                           then  @InstituteId
								   else Ac.InstituteId
								   end
		   and @AcademicSessionId=case when @AcademicSessionId=0
		                           then  @AcademicSessionId
								   else StA.AcademicSessionId
								   end
		   and @AcademicBranchId=case when @AcademicBranchId=0
		                           then  @AcademicBranchId
								   else StA.AcademicBranchId
								   end
		   and @AcademicClassesId=case when @AcademicClassesId=0
		                           then  @AcademicClassesId
								   else StA.AcademicClassId
								   end
		  and @AcademicSectionId=case when @AcademicSectionId=0
		                           then  @AcademicSectionId
								   else StA.AcademicSectionId
								   end
		  and @AcademicPeriodId=case when @AcademicPeriodId=0
		                           then  @AcademicPeriodId
								   else StA.AcademicPeriodId
								   end
		  and @Year=case when @Year=0
		                           then  @Year
								   else year(StA.AttendanceDate)
								   end
         and @Month=case when @Month=0
		                           then  @Month
								   else  month(StA.AttendanceDate)
								   end
         and @Day=case when @Day=0
		                           then  @Day
								   else day( StA.AttendanceDate)
								   end
         and @StudentId=case when @StudentId=0
		                           then  @StudentId
								   else st.StudentId
								   end

	  --exec AttendanceReports 0,0,6,0,0,0,0,0,0,35
GO
