CREATE procedure [dbo].[StudentList]
         @InstituteId int,
		 @AcademicSessionId int,
		 @AcademicBranchId int,
		 @AcademicClassesId int, 
		 @AcademicShiftId int,		 
		 @AcademicSectionId int

as 
select 
       UInfo.InstituteId
      ,AcCSees.Id as CurrentSessionId
	  ,AcCSees.Name as CurrentSessionName
	  ,AcCBranch.Id as CurrentBranchId
	  ,AcCBranch.Name as CurrentBranchName
	  ,AcC.Id as CurrentClassId
	  ,AcC.Name as CurrentClassName
	  ,AcCShift.Id as CurrentShiftId
	  ,AcCShift.Name as CurrentShiftName
	  ,AcCSec.Id as CurrentSectionId
	  ,AcCSec.Name as CurrentSectionName
	  ,st.StudentId
	  ,UInfo.FirstName
	  ,UInfo.MiddleName
	  ,UInfo.LastName
	  ,UInfo.Name as StudentName
	  ,St.CurrentRollNo
	  ,UInfo.ContactNumber1
	  ,UInfo.ContactNumber2
	  ,UInfo.DOB
	  ,UInfo.EmailAddress
	  ,gen.Id as GenderId
	  ,gen.Name as GenderName
	  ,bg.Id as BloodGroupid
	  ,bg.Name as BloodGroupName
	  ,rel.Id as RelegionId
	  ,rel.Name as ReligionName	  
	 from Students as St 
				inner join UserInfoes as UInfo on UInfo.Id=St.StudentId and UInfo.InstituteId=@InstituteId 
				inner join AcademicSessions as AcCSees on AcCSees.Id=St.CurrentAcademicSessionId
				inner join AcademicBranches as AcCBranch on AcCBranch.Id=St.CurrentAcademicBranchId					
                inner join AcademicClasses as AcC on AcC.Id=St.CurrentAcademicClassId
				inner join AcademicShifts as AcCShift on AcCShift.Id=St.CurrentAcademicShiftId	
				inner join AcademicSections as AcCSec on AcCSec.Id=St.CurrentAcademicSectionId
				left join Genders as gen on gen.Id=UInfo.GenderId
				left join BloodGroups as bg on bg.Id=UInfo.BloodGroupId
				left join Religions as rel on rel.Id=UInfo.ReligionId

			    where 1=1 and UInfo.UserInfoTypeId=11-- 11 for student type
				     and UInfo.InstituteId=case when  @InstituteId=0
				               then UInfo.InstituteId
							   else @InstituteId
				              end   
				      and St.CurrentAcademicSessionId=case when  @AcademicSessionId=0
				               then St.CurrentAcademicSessionId
							   else @AcademicSessionId
							   end
                      and St.CurrentAcademicClassId=case when  @AcademicClassesId=0
				               then St.CurrentAcademicClassId
							   else @AcademicClassesId
							   end
					  and St.CurrentAcademicSectionId=case when  @AcademicSectionId=0
				               then St.CurrentAcademicSectionId
							   else @AcademicSectionId
							   end
	

--Exec StudentList 5,0,0,11,0,5
